import React from 'react';
import './App.css';
import About from './Components/About';
import Home from './Components/Home';
import LogIn from './Components/LogIn';

import { BrowserRouter as Router, Routes, Route, Link} from 'react-router-dom'



function App() {
  return (
    <>
      <Router>
        <nav>
          <li><Link className='Penis' to="/">Home</Link></li>
          <li><Link className='Penis' to="/About">About</Link></li>
          <li><Link className='Penis' to="/logIn">Log in</Link><span className='gray' > â¤Œ Use this</span></li>
        </nav>
          <Routes>
              <Route exact path="/" element={() => <Home title="Log In"/>}/>
              <Route path="/about" element={<About/>}/>
              <Route path="/logIn" element={<LogIn/>}/>
          </Routes>
      </Router>
    </>
  );
}

export default App;
